import React, { useState } from 'react';

export default function App() {
  const [noCount, setNoCount] = useState(0);
  const [yesPressed, setYesPressed] = useState(false);

  const phrases = [
    "LAA",
    "mt2aked A HUBBYYY?",
    "Hbibaaaaa please ü•∫",
    "Mab9itich Katbghini ü•∫",
    "Jrehtiiini üò¢",
    "Seeer Fhalk ...Ghanbki üò≠",
    "Wa ghi zed faker!",
    "YA DEK IKHAN ZED FAKER?",
    "RA BITNDEM YA DEK W9!",
    "HUHHH??",
    "Pwease ü•∫",
    "I'll be sad...",
    "mCHI Fhalk !! Safi bna9es...",
    "A tandhak ya ana ya tmout !",
    "WAAAAA SAAAAFIII!"
  ];

  const getNoButtonText = () => {
    return phrases[Math.min(noCount, phrases.length - 1)];
  };

  const handleNoClick = () => {
    setNoCount(noCount + 1);
  };

  if (yesPressed) {
    return (
      <div style={{
        minHeight: '100vh',
        background: '#ffc9d9',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        fontFamily: '"Quicksand", sans-serif',
        position: 'relative',
        overflow: 'hidden'
      }}>
        {/* Confetti */}
        {[...Array(50)].map((_, i) => (
          <div
            key={i}
            style={{
              position: 'absolute',
              width: '10px',
              height: '10px',
              background: ['#ff6b9d', '#ffd93d', '#6bcf7f', '#4d9fff', '#ff8364', '#c780e8'][i % 6],
              left: `${Math.random() * 100}%`,
              top: '-10px',
              animation: `fall ${2 + Math.random() * 2}s linear infinite`,
              animationDelay: `${Math.random() * 2}s`,
              borderRadius: Math.random() > 0.5 ? '50%' : '0'
            }}
          />
        ))}

        <style>{`
          @import url('https://fonts.googleapis.com/css2?family=Quicksand:wght@400;500;600;700&display=swap');

          @keyframes fall {
            to {
              transform: translateY(100vh) rotate(360deg);
            }
          }

          @keyframes bounce {
            0%, 100% { transform: scale(1); }
            50% { transform: scale(1.1); }
          }
        `}</style>

        <div style={{
          fontSize: '160px',
          marginBottom: '20px',
          animation: 'bounce 1s ease-in-out infinite'
        }}>
          üòªüíùüò∏
        </div>

        <h1 style={{
          fontSize: '80px',
          fontWeight: '700',
          color: '#ff6b9d',
          margin: '20px 0',
          textAlign: 'center'
        }}>
          Yipee!!!
        </h1>

        <p style={{
          fontSize: '28px',
          color: '#ff3d7f',
          fontWeight: '600'
        }}>
          I'm so happy! üíï
        </p>
      </div>
    );
  }

  return (
    <div style={{
      minHeight: '100vh',
      background: '#ffc9d9',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      fontFamily: '"Quicksand", sans-serif',
      padding: '20px'
    }}>
      <style>{`
        @import url('https://fonts.googleapis.com/css2?family=Quicksand:wght@400;500;600;700&display=swap');

        .yes-btn {
          transition: all 0.2s;
        }

        .yes-btn:hover {
          transform: scale(1.05);
        }

        .yes-btn:active {
          transform: scale(0.95);
        }

        .no-btn {
          transition: all 0.2s;
        }

        .no-btn:hover {
          transform: scale(1.05);
        }

        .no-btn:active {
          transform: scale(0.95);
        }
      `}</style>

      <h1 style={{
        fontSize: '60px',
        fontWeight: '700',
        color: '#ff6b9d',
        marginBottom: '10px',
        textAlign: 'center',
        lineHeight: '1.2'
      }}>
        ‚ô° Will you be my Valentine? ‚ô°
      </h1>

      <div style={{
        fontSize: '140px',
        margin: '40px 0',
        display: 'flex',
        gap: '20px',
        alignItems: 'center'
      }}>
        <span>üêª</span>
        <span>üåπ</span>
        <span>üëë</span>
      </div>

      <div style={{
        display: 'flex',
        gap: '20px',
        marginTop: '20px',
        flexWrap: 'wrap',
        justifyContent: 'center'
      }}>
        <button
          className="yes-btn"
          onClick={() => setYesPressed(true)}
          style={{
            backgroundColor: 'white',
            color: '#ff3d7f',
            border: '3px solid #ff3d7f',
            borderRadius: '30px',
            padding: '15px 50px',
            fontSize: '26px',
            fontWeight: '700',
            cursor: 'pointer',
            fontFamily: 'inherit',
            boxShadow: '0 4px 0 #ff3d7f'
          }}
        >
          Yes
        </button>

        <button
          className="no-btn"
          onClick={handleNoClick}
          style={{
            backgroundColor: 'white',
            color: '#999',
            border: '3px solid #ddd',
            borderRadius: '30px',
            padding: '15px 50px',
            fontSize: Math.max(16 - noCount, 12) + 'px',
            fontWeight: '700',
            cursor: 'pointer',
            fontFamily: 'inherit',
            boxShadow: '0 4px 0 #ddd'
          }}
        >
          {getNoButtonText()}
        </button>
      </div>

      {noCount > 0 && (
        <p style={{
          marginTop: '30px',
          fontSize: '24px',
          fontWeight: '600',
          color: '#ff3d7f',
          textAlign: 'center'
        }}>
          I know you want to say yes! üíï
        </p>
      )}
    </div>
  );
}
